const API_URL = 'http://localhost:3000'

 const data = {};
 function fetchAPI() {
     fetch(`${API_URL}/api/testAPI`)
    .then ((data) => {
        console.log(data);
        console.log("parsing")
        return data.json();
    })
    .then((response) => {
        console.log(response); 

    })
}


export default {fetchAPI, data}
